--Creating the Order details table
DROP TABLE IF EXISTS order_details;
CREATE TABLE order_details(
	order_details_id SERIAL PRIMARY KEY,
	order_id SMALLINT,
	order_date DATE DEFAULT TO_DATE('1/13/2023', 'MM/DD/YYYY'),
	order_time TIME,
	item_id INT,
	quantity INT
);

